import React from "react";
import { Link } from "react-router-dom";

const AllQuotes = () => {
  return (
    <>
      <h1>AllQuotes</h1>
      <Link to="/quotes/:quoteId/comments">comment</Link>
    </>
  );
};

export default AllQuotes;
